    internal class SupportedWalletList
    {
        class WalletCompare : IComparer<WalletSelectItem>
        {
            public int Compare(WalletSelectItem x, WalletSelectItem y)
            {
                return x.Name.ToLower().CompareTo(y.Name.ToLower());
            }
        }

        public static List<WalletSelectItem> SupportedWalletNames()
        {
            List<WalletSelectItem> result = new List<WalletSelectItem>();
            string json = WalletListJson();
            Dictionary<string, AppEntry> data = JsonConvert.DeserializeObject<Dictionary<string, AppEntry>>(json);

            foreach (var id in data.Keys)
            {
                result.Add(new WalletSelectItem(id, data[id].name));
            }

            result.Sort(new WalletCompare());

            return result;
        }

